import { Container } from 'react-bootstrap'

import Header from './components/header'
import Footer from './components/footer'


function App() {
  return (
    <div>
      <Header />
      <main>
        <Container>
          <h1 class='text-center'>Wellcome</h1>
        </Container>

      </main>
      <Footer />  
    </div>
  );
}

export default App;
